CREATE TABLE `t_sys_org_user` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `org_id` int(11) unsigned NOT NULL DEFAULT '0' COMMENT '机构编号',
  `user_id` int(11) unsigned NOT NULL DEFAULT '0' COMMENT '角色编号',
  PRIMARY KEY (`id`),
  KEY `org_id` (`org_id`),
